import React from 'react'
import ReactDOM from 'react-dom/client'

const BookList = () => {

    return (
      <section>
        <Book></Book>
        <Book></Book>
      </section>
    )
};

const Book = () => {
    return (
        <article>
            <Image/>
            <Title/>
            <Author/>
        </article>
    );
};

const Image = () =>  (
  <img src='https://www.amazon.in/Atomic-Habits-James-Clear/dp/1847941834/ref=zg_bs_g_books_d_sccl_2/260-5758417-3690723?psc=1'alt='Atomic habit'></img>
) ;

const Title = () =>  <h2>Title</h2> ;

const Author = () =>  <h2>Author</h2> ;



const root = ReactDOM.createRoot(document.getElementById('root'));


root.render(<BookList/>);
